measurements.description:
One flower on one 28.3-cm inflorescence; 
	dorsal sepal mucronate, light burgundy striated saturated-burgundy;
    synsepal burgundy, striated saturated-burgundy;	

	petals ciliate, saturated burgundy, streaked light burgundy distally; 
	pouch downy, black-burgundy; 
    staminode green basally, light burgundy distally;
	substance hard; texture glossy.
